Resource.create([archetype_id: (Archetype.find_by name: 'scopeNote').id, literal: "مصطلح عام يستخدم للأعمال الفنية والاقتصادية حول التعدين والميتالورجيا والمعادن ذات القيمة الاقتصادية. الأعمال المتعلقة بالتعدين فقط تكشف باستخدام هندسة المناجم, اما تلك المتعلقة بالميتالورجيا فتدخل تحت الميتالورجيا", language_id: (Language.find_by name: 'ar').id])
Resource.create([archetype_id: (Archetype.find_by name: 'scopeNote').id, literal: "一般性术语，用于有关采矿、冶金和有经济价值的矿物的技术和经济著作。仅关于采矿的著作列在\"采矿\"或\"采矿工程\"下，而仅关于冶金的著作列在\"冶金\"下。", language_id: (Language.find_by name: 'zh').id])
Resource.create([archetype_id: (Archetype.find_by name: 'scopeNote').id, literal: "A general term to be used for technical and economic works on mining, metallurgy, and minerals of economic value.  Works dealing only with mining are indexed under MINING or MINING ENGINEERING, while those dealing only with metallurgy are entered under METALLURGY", language_id: (Language.find_by name: 'en').id])
Resource.create([archetype_id: (Archetype.find_by name: 'scopeNote').id, literal: "Применительно к техническим и экономическим работам, посвященным горному делу, металлургии и экономически ценным полезным ископаемым. Работы, посвященные только горному делу, заносятся под рубрики \"Горное дело\" и \"Горная инженерия\", а только металлургии - \"Металлургия (наука)\"", language_id: (Language.find_by name: 'ru').id])
Resource.create([archetype_id: (Archetype.find_by name: 'scopeNote').id, literal: "Usese para trabajos técnicos y económicos sobre minería, metalurgia y minerales de valor económico. Para los trabajos relacionados exclusivamente con la minería, úsese MINERIA o INGENIERIA DE MINAS,para los relacionados exclusivamente con la metalurgia, úsese METALURGIA", language_id: (Language.find_by name: 'es').id])
