Resource.create([archetype_id: (Archetype.find_by name: 'scopeNote').id, literal: "用于作为自然资源的矿床，可根据国际法进行勘探、开采、地质研究和保护。不要与\"矿物\"相混。", language_id: (Language.find_by name: 'zh').id])
