Resource.create([archetype_id: (Archetype.find_by name: 'scopeNote').id, literal: "Utiliser pour les dépôts minéraux en tant que ressources naturelles, pouvant faire l'objet d'une exploration, extraction, recherche géologique, conservation et protection au regard du droit international. A ne pas confondre avec MINERAUX", language_id: (Language.find_by name: 'fr').id])
Resource.create([archetype_id: (Archetype.find_by name: 'scopeNote').id, literal: "О месторождениях полезных ископаемых как о природных ресурсах, являющихся объектом разведки, разработки, геологического изучения, сбережения и международно-правовой защиты. Не путать с дексриптором «Полезные ископаемые»", language_id: (Language.find_by name: 'ru').id])
Resource.create([archetype_id: (Archetype.find_by name: 'scopeNote').id, literal: "Usese para los depósitos minerales como recursos naturales sujetos de explotación, extracción, investigación geológica, conservación y protección bajo derecho internacional. No se confunda con MINERALES", language_id: (Language.find_by name: 'es').id])
